import React from "react";
import { Row,Col,Button } from "reactstrap";

class Editor extends React.Component{

    render(){
        return(
            <Row>
                <Col lg="12" md="12" sm="12" xs="12">
                    <div className="editor">
                        <div className="editor-nav">
                            <Button size="sm"><i class="fas fa-save"></i> Save</Button>
                            <Button  size="sm"><i class="fas fa-share-alt"></i> Share</Button>
                            <Button  size="sm" style={{padding:"4px",paddingLeft:"15px",paddingRight:"15px"}}><i class="fas fa-compress"></i></Button>
                            
                        </div>
                    </div>
                </Col>
            </Row>
        );
    }
}
export default Editor;
